<style>
    svg {
        width: 100%;
        height: auto;
        object-fit: cover;
        display: inline-block;
        margin: 0 auto;
        transition: width 150ms ease-in-out;
    }

    .shadow {
        filter: drop-shadow(6px 0px 12px var(--cisco-gray));
    }

    .hot-spot,
    .hot-spot:hover {
        cursor: pointer;
    }

    .hot-spot.active {
        fill: var(--cisco-blue);

        animation: pulse1 3s infinite ease-in-out;
        -webkit-animation: pulse1 3s infinite ease;
    }

    .marker.active {
        -webkit-animation: ping 1.5s ease-in-out infinite both;
        animation: ping 1.5s ease-in-out infinite both;
    }
    .hot-spot.active .markerSlideThree,
    .hot-spot.active .markerSlideFour,
    .hot-spot.active .markerSlideZero,
    .hot-spot.active .markerSlideOne,
    .hot-spot.active .markerSlideTwo,
    .marker.active {
        fill: var(--cisco-blue);
        stroke: var(--cisco-blue);
        stroke-width: 2px;
    }

    @-webkit-keyframes ping {
        0% {
            -webkit-transform: scale(0.2);
            transform: scale(0.2);
            opacity: 0.8;
        }
        80% {
            -webkit-transform: scale(1.2);
            transform: scale(1.2);
            opacity: 0;
        }
        100% {
            -webkit-transform: scale(2.2);
            transform: scale(2.2);
            opacity: 0;
        }
    }
    @keyframes ping {
        0% {
            -webkit-transform: scale(0.2);
            transform: scale(0.2);
            opacity: 0.8;
        }
        80% {
            -webkit-transform: scale(1.2);
            transform: scale(1.2);
            opacity: 0;
        }
        100% {
            -webkit-transform: scale(2.2);
            transform: scale(2.2);
            opacity: 0;
        }
    }

    .markerLineSlideOne,
    .markerLineSlideTwo,
    .markerLineSlideThree,
    .markerLineSlideFour,
    .markerLineSlideZero {
        stroke: var(--cisco-gray);
        stroke-width: 1px;
        transition: all 1.5s ease-out;
    }

    .activeLines {
        stroke: var(--cisco-blue);
        stroke-width: 2px;
    }

    .markerSlideThree,
    .markerSlideFour,
    .markerSlideZero,
    .markerSlideOne,
    .markerSlideTwo,
    .marker {
        fill: var(--cisco-gray);
        stroke: var(--cisco-gray);
        stroke-width: 1px;
        transition: all 0.5s ease-out;
    }

    @keyframes pulse1 {
        0% {
            filter: drop-shadow(0px 0px 2px #0076d5);
        }

        30% {
            filter: drop-shadow(0px 0px 3px #00abe6);
        }
        50% {
            filter: drop-shadow(0px 0px 4px #0099e0);
        }
    }

    @-webkit-keyframes pulse1 {
        0% {
            filter: drop-shadow(0px 0px 2px #0076d5);
        }

        30% {
            filter: drop-shadow(0px 0px 3px #00abe6);
        }
        50% {
            filter: drop-shadow(0px 0px 4px #0099e0);
        }
    }

    @media only screen and (min-width: 769px) and (max-width: 1023px) {
        svg {
            width: 80%;
            height: auto;
        }
    }

    @media only screen and (min-width: 1024px) {
        svg {
            width: 60%;
            overflow: visible;
        }
    }

    @media only screen and (min-width: 401px) and (max-width: 768px) {
        svg {
            width: 100% !important;
            height: auto;
        }
